import './App.css';
import React from 'react';
import Navbar from './components/Navbar';
import Home from './components/Home';
import {Route, Router} from 'react-router-dom';


function App() {
  return (
    <>
      <Navbar/>
      <Router>
          <Route exact path="/" component={Home} />
      </Router>
    </>
  );
}

export default App;
